(12671, '/Projektni_zadatak/upravljanje/vrati_sigurnosnu_kopiju/', 'INSERT INTO vlak VALUES (2, \'Vruƒáa stvar\', 80, 185, \'Stari vlak, male brzine, jer je parni vlak.\', 3, 6),\n(5, \'Eko-Elektro\', 130, 300, \'Eko-Elektro je vlak koji se brine za okoli≈°, jer je elektriƒçni vlak modernog dizajna sa mnogo sjedala.\', 2, 9),\n(6, \'Mrak\', 105, 150, \'Mrak je prosjeƒçan vlak sa pogonom na benzin\', 4, 6),\n(8, \'Mjesec\', 148, 192, \'Mjesec je vlak na benzin, modernog dizajna i modernim uslugama (poput wifi, mini tv, WC, usluge bara i sliƒçno).\', 4, 9),\n(12, \'Elektro vlak\', 160, 300, \'Elektriƒçni vlak\', 2, 4),\n(22, \'Gromp\', 160, 103, \'Gromp je srednji vlak, modernog izgleda. Najpoznatiji vlak u sjevernom sijelu rumunjske. \', 9, 3),\n(23, \'Resetka\', 32, 323, \'Veliki i moderni vlak. Vrsta pogona na≈°e kokice je parni pogon. \', 3, 3),\n(25, \'Magnetska strijela\', 320, 350, \'Veliki i moderni vlak. Vrsta pogona na≈°e kokice je parni pogon. \', 3, 3),\n(26, \'Loki\', 160, 310, \'Loki je spori vlak sa mnogo broja sjedala\', 9, 1),\n(39, \'Kravica\', 123, 135, \'kravica je maleni vlakiƒá, sa raznolikim bojama. Vo≈ænja je izrazito ugodna i osvje≈æavajuƒáa.\', 2, 1),\n(42, \'Magnetska strijela\', 123, 222, \'Relativno brzi vlak, sa dovoljno broj sjedala. Modernog izgleda.\', 2, 1)\n', '2021-08-22 17:55:43', 2, 1),
